import React from 'react';
import * as AiIcons from "react-icons/ai";

export const SidebarData = [
    {
        title: "Tasarım Tişört",
        path: "/tisort",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Basic Tişört",
        path: "/basictisort",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Atlet",
        path: "/atlet",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Şort",
        path: "/sort",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Pantolon",
        path: "/pantolon",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Çanta",
        path: "/canta",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Ceket",
        path: "/ceket",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Kapşonlu",
        path: "/kapsonlu",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Sweatshirt",
        path: "/sweatshirt",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    }, {
        title: "Bere",
        path: "/bere",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Çorap",
        path: "/corap",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Kampanyalı Ürünler",
        path: "/kampanyaliurunler",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Üniversiteliye %20 İndirim",
        path: "/indirim",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Kaft Çorap - 3 Al 2 Öde",
        path: "/corap",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Kaft Hakkında",
        path: "/about",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Tasarımcılar",
        path: "/tasarimcilar",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "KAFT Colors",
        path: "/colors",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Lookbook",
        path: "/lookbook",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Journeys",
        path: "/journeys",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "KAFT Interviews",
        path: "/interviews",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "KAFTsoul - Fotoğraflarınız",
        path: "/fotograflariniz",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Hediye Kartı",
        path: "/GiftCard",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Tişört Serileri",
        path: "/series",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "43. İstanbul Film Festivali",
        path: "/filmfestivali",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    }, {
        title: "HOOD Base Serisi",
        path: "/hoodbaseseries",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    }, {
        title: "Sketch Serisi",
        path: "/sketchseries",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    }, {
        title: "NVDIA X KAFT",
        path: "/nvidia",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "TEMA X KAFT",
        path: "/tema",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Fujifilm X KAFT",
        path: "/fujifilm",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Sürdürülebilirlik",
        path: "/tema",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text-title'
    },
    {
        title: "Zamansız Hikayeler Yaratmak Zaman Alır",
        path: "/sustainability",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "TEMA X KAFT",
        path: "/tema",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Üyelik & Sertifikalar",
        certificates: [
            "Better Cotton Initiative (BCI)",
            "OEKO-TEX® STANDARD 100"
        ],
        path: "/sertifika",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Sipariş Takibi",
        path: "/siparistakibi",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "İade ve Değişim",
        path: "/iadevedegisim",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Satış Noktaları",
        path: "/satisnoktalari",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Ekibe Katıl",
        path: "/ekibekatil",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "Yardım",
        path: "/yardim",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
    {
        title: "İletişim",
        path: "/iletisim",
        icon: <AiIcons.AiFillHome />,
        cName: 'nav-text'
    },
]
